-- This module contains parameters for Low and Chuang's Quantum Signal
-- Processing (QSP) algorithm for Hamiltonian simulation as described
-- in
--
-- Guang Hao Low and Isaac L. Chaung, Hamiltonian Simulation by
-- Qubitization. (2016). Available from
-- https://arxiv.org/abs/1610.06546.
--
-- Further implementation details about the algorithms can be found in
-- the following paper.
--
-- Andrew M. Childs, Dmitri Maslov, Yunseong Nam, Neil J. Ross, and
-- Yuan Su. Toward the first quantum simulation with quantum
-- speedup. (2017).

module Parameters where

import Quipper

import System.Random
import Libraries.RandomSource
import Libraries.Sampling

import Definitions

-- ===================================================================
-- Given a Hamiltonian, an evolution time, and a desired accuracy,
-- compute a sequence of rotation angles of the appropriate length for
-- the QSP algoritm (given as pairs of angles). This function is only
-- defined for some fixed values of epsilon (0.001 and 0.0005) and of
-- n (13, 16, 20, 25, 32, 40, 42, 44, 46, 48 50, 52, 54, 56, 58, 63,
-- 79, and 100).
anglepairs :: Hamiltonian -> Time ->  Accuracy -> [(Double,Double)]
anglepairs h t eps = take (f eps $ hamiltonian_size h) randompairs
  where
    g = mkStdGen 1
    randompairs = sample_random g (0,0) (2*pi, 2*pi)
    
    f :: Accuracy -> Int -> Int
    f 0.001 13 = 924
    f 0.001 16 = 1398
    f 0.001 20 = 2180
    f 0.001 25 = 3404
